import React from "react";

const LoginPage = () => {
  return (
    <div style={styles.container}>
      {/* Login Section */}
      <div style={styles.loginBox}>
        <h2 style={styles.title}>Welcome Back!</h2>
        <p style={styles.subText}>
          To keep connected with us please log in with your personal info
        </p>

        <div style={styles.socialIcons}>
          <a href="https://www.facebook.com" target="_blank" rel="noopener noreferrer">
            <img src="/facebook-icon.png" alt="Facebook" style={styles.icon} />
          </a>
          <a href="https://www.google.com" target="_blank" rel="noopener noreferrer">
            <img src="/google-icon.png" alt="Google" style={styles.icon} />
          </a>
          <a href="https://www.linkedin.com" target="_blank" rel="noopener noreferrer">
            <img src="/linkedin-icon.png" alt="LinkedIn" style={styles.icon} />
          </a>
        </div>

        <p style={styles.orText}>or use your email</p>

        <input type="email" placeholder="Email" style={styles.input} />
        <div style={styles.passwordContainer}>
          <input type="password" placeholder="Password" style={styles.passwordInput} />
          <span style={styles.eyeIcon}>üëÅÔ∏è</span>
        </div>
        <button style={styles.signInButton}>SIGN IN</button>
      </div>

      {/* Sign Up Section */}
      <div style={styles.signupBox}>
        <h2 style={styles.signupTitle}>New Here?</h2>
        <p style={styles.signupText}>
          Sign up and discover a great amount of educational events!
        </p>
        <button style={styles.signupButton}>SIGN UP</button>
      </div>
    </div>
  );
};

const styles = {
  container: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    height: "100vh",
    background: "#FFFFFF", // White background
    fontFamily: "'Poppins', sans-serif",
  },
  loginBox: {
    flex: 1,
    padding: "40px",
    maxWidth: "400px",
    background: "#FFFFFF",
    borderRadius: "10px",
    textAlign: "center",
    boxShadow: "0 4px 10px rgba(0, 0, 0, 0.1)",
  },
  title: {
    fontSize: "24px",
    fontWeight: "bold",
    color: "#000", // Black text
  },
  subText: {
    fontSize: "14px",
    color: "#333",
    marginBottom: "15px",
  },
  socialIcons: {
    display: "flex",
    justifyContent: "center",
    gap: "15px",
    marginBottom: "10px",
  },
  icon: {
    width: "40px",
    height: "40px",
    cursor: "pointer",
  },
  orText: {
    margin: "10px 0",
    color: "#555",
  },
  input: {
    width: "100%",
    padding: "10px",
    margin: "8px 0",
    borderRadius: "5px",
    border: "1px solid #AAA",
    fontSize: "14px",
  },
  passwordContainer: {
    position: "relative",
  },
  passwordInput: {
    width: "100%",
    padding: "10px",
    borderRadius: "5px",
    border: "1px solid #AAA",
    fontSize: "14px",
  },
  eyeIcon: {
    position: "absolute",
    right: "10px",
    top: "50%",
    transform: "translateY(-50%)",
    cursor: "pointer",
  },
  signInButton: {
    width: "100%",
    padding: "12px",
    marginTop: "10px",
    background: "#53917E",
    color: "white",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
    fontSize: "16px",
    fontWeight: "bold",
  },
  signupBox: {
    flex: 1,
    padding: "40px",
    maxWidth: "400px",
    background: "#53917E",
    borderRadius: "10px",
    textAlign: "center",
    color: "white",
    boxShadow: "0 4px 10px rgba(0, 0, 0, 0.1)",
  },
  signupTitle: {
    fontSize: "24px",
    fontWeight: "bold",
  },
  signupText: {
    fontSize: "14px",
    marginBottom: "15px",
  },
  signupButton: {
    background: "#6D1A36",
    color: "white",
    padding: "12px 20px",
    borderRadius: "5px",
    border: "none",
    cursor: "pointer",
    fontSize: "16px",
  },
};

export default LoginPage;
